import './App.css';
import Dashboard from "./layouts/Dashboard";
import Navigation from "./layouts/Navigation";
import 'semantic-ui-css/semantic.min.css'



function App() {
  return (
    <div className="App">

      <Navigation />
      <Container className="main">
        <Dashboard />
      </Container>


    </div>
  );
}

export default App;
